          <div className="App">
            <Subject title="WEB" sub="World Wide Web zz"></Subject>
            <Subject title="React" sub="React.js"></Subject>
            <TOC></TOC>
            <Content title="HTML" desc="HTML is HyperText Markup Language."></Content>
          </div>
        );
  }
}

export default App;
